const css = require('css');
//const layout = require('./layout.js');
const EOF = Symbol('EOF');

let currentToken = null;
let currentAttribute = null;
let stack = [{type:'document',children:[]}]
let currentTextNode = null;
let rules = [];

function addCSSRules(text){
    var ast = css.parse(text);
    rules.push(...ast.stylesheet.rules);
}

function match(element, selector){
    if(!selector || !element.attributes){
        return false;
    }

    if(selector.charAt(0) === '#'){
        var attr = element.attributes.filter(attr => attr.name === 'id')[0];
        if(attr && attr.value === selector.replace('#', '')){
            return true;
        }
    }else if(selector.charAt(0) === '.'){
        var classObj = element.attributes.filter(attr => attr.name === 'class')[0];
        let classArr = classObj?classObj.value.split(' '):null;
        if(classArr && classArr.includes(selector.replace('.',''))){
            return true;
        }
    }else{
        if(element.tagName === selector){
            return true;
        }
    }
    return false;
}

function specificity(selector){
    var p = [0, 0, 0, 0];
    var selectorParts = selector.split(' ');
    for(var part of selectorParts){
        if(part.charAt(0) === '#'){
            p[1] += 1;
        }else if(part.charAt(0) === '.'){
            p[2] += 1;
        }else{
            p[3] += 1;
        }
    }  
    return p;
}

function compare(sp1,sp2){
    if(sp1[0] - sp2[0]){
        return sp1[0] - sp2[0];
    }
    if(sp1[1] - sp2[1]){
        return sp1[1] - sp2[1];
    }
    if(sp1[2] - sp2[2]){
        return sp1[2] - sp2[2];
    }

    return sp1[3] - sp2[3];
}

function computeCSS(element){
    var elements = stack.slice().reverse();

    if(!element.computedStyle){
        element.computedStyle = {};
    }

    for(let rule of rules){
        var selectorParts = rule.selectors[0].split(" ").reverse();

        if(!match(element,selectorParts[0]))
            continue;

        let matched = false;

        var j = 1;
        for(var i= 0;i<elements.length;i++){
            if(match(elements[i],selectorParts[j])){
                j++;
                if(j === selectorParts.length){
                    break;
                } 
            }
        }   

        if(j >= selectorParts.length){
            matched = true;
        }

        if(matched){
            var sp = specificity(rule.selectors[0]);

            var computedStyle = element.computedStyle;
            for(let {property,value} of rule.declarations){
                if(!computedStyle[property]){
                    computedStyle[property] = {}
                }
                if(!computedStyle[property].specificity){
                    computedStyle[property].value = value;
                    computedStyle[property].specificity = sp;
                }else if(compare(computedStyle[property].specificity, sp) < 0){
                    computedStyle[property].value = value;
                    computedStyle[property].specificity = sp;
                }
            }
        }
    }
}

function emit(token){
    let top = stack[stack.length - 1];
    if(token.type === 'startTag'){
        let element = {
            type:'element',
            children:[],
            attributes:[]
        };
        element.tagName = token.tagName;

        for(let p in token){
            if(p!== 'type' && p!="tagName"){
                element.attributes.push({
                    name:p,
                    value:token[p]
                });
            }
        }

        computeCSS(element);

        top.children.push(element);
        if(!token.isSelfClosing){
            stack.push(element);
        }

        currentTextNode = null;

    }else if(token.type === 'endTag'){
        if(top.tagName != token.tagName){
            throw new Error('Tag Start end doesn\'t match!')
        }else{

            if(top.tagName === "style"){
                addCSSRules(top.children[0].content);
            }
            //layout(top);
            stack.pop();
        }
        currentTextNode = null;
    } else if(token.type === 'text'){
        if(currentTextNode === null){
            currentTextNode = {
                type:'text',
                content:''
            };
            top.children.push(currentTextNode);
        }
        currentTextNode.content += token.content;
    }
}


function data(c){
    if(c === '<'){
        return tagOpen;
    }else if(c === EOF){
        emit({
            type:'EOF'
        })
        return;
    }else{
        emit({
            type:'text',
            content:c
        })
        return data;
    }
}

function tagOpen(c){
    if(c === '/'){
        return endTagOpen;
    }else if(c.match(/^[a-zA-Z]$/)){
        currentToken = {
            type: 'startTag',
            tagName: ''
        }
        return tagName(c);
    }else{
        return;
    }
}

function endTagOpen(c){
    if(c.match(/^[a-zA-Z]$/)){
        currentToken = {
            type: 'endTag',
            tagName: ''
        }
       return tagName(c);
    }else if(c  === '>'){
        throw Error('Something wrong')
    }else if(c === EOF){
